					function update(Request $request) {
						$this->config->fileView = 'form';
						$this->config->toView['title_page'] = 'Editar';
						$this->config->toView['url_page_action'] = '/update';
						$this->config->toView['title'] = 'Alterar a Inscrição';
						$this->config->toView['subtitle'] = 'Edite informações referente a Inscrição.';

						$payload = OrderModel::with([
							'student.state',
							'formPayment',
							'class',
							'orderParcel' => function($query) {
								$query->withTrashed();
							},
							'course',
							'courseFormPayment' => function($query) {
								$query->with([
									'formPayment',
									'course' => function($query) {
										$query->with([
											'courseCategory',
											'courseCategoryType',
											'courseSubcategory',
										]);
									},
								]);
							},
							'errorAsaas',
							])->find($request->id);

							$listSelectBox = $this->getListSelectBox();
							$listSelectBox->status = OrderModel::getStatusList();
							$listSelectBox->bank = BankModel::orderBy('name')->get();
							$listSelectBox->formPayment = FormPaymentModel::orderBy('description')->get();
							$listSelectBox->responsible = UserModel::orderBy('name')->get();
							$listSelectBox->course = CourseModel::select([ 'id', 'course_category_id', 'title_pt', ])
							->with([
								'class' => function($query) {
									$query->select([ 'id', 'name', 'course_id', ]);
								},
								])
								->where('course_category_id', $payload->course->course_category_id)
								->orderBy('title_pt')
								->get();

								$listSelectBox->courseFormPayment = CourseFormPaymentModel::where('course_id', $payload->course_id)->with([
									'formPayment',
									])->get();

									$payload->subOrder = OrderModel::with([
										'formPayment',
										'orderParcel' => function($query) {
											$query->withTrashed();
										},
										])->where('order_id', $payload->id)->get();

										$view = view('admin/prospection/student/form')
										->with('listSelectBox', $listSelectBox)
										->with('payload', $payload);

										return $view;
									}

									function save(Request $request) {

										$orderModel = OrderModel::find($request->get('id'));

										if ($orderModel) {
											$input = $request->all();

											$input['contract'] = "contract/contract_{$input['id']}.pdf";

											$orderModel->fill($input)->save();

											(new StudentClassControlUtils)->generateByOrder($request->get('id'));

											switch ($orderModel->status) {
												case 'AP':
													$this->generateContract($orderModel->id);
													break;
													case 'FI':
														// $this->finalizationProcess($orderModel->id);
														break;
														// case 'CA':
															// 	$this->cancellationProcess($orderModel->id);
															// 	break;
														}

														if(!empty($request->file('contractFile'))) {
															$request->file('contractFile')->move('../storage/app/contract', "contract_{$input['id']}.pdf");
															return redirect()->back();
														}
													}

													return 'OK';
												}

												function orderParcel(Request $request) {
													$orderParcelModel = OrderParcelModel::where('id', $request->get('id'));

													switch ($request->get('action')) {
														case 'pay': return $orderParcelModel->update([
															'payday' => \Carbon\Carbon::now(),
														]);
														case 'notPay': return $orderParcelModel->update([
															'payday' => null,
														]);
														case 'delete': return $orderParcelModel->delete();
													}

													return $request->all();
												}

												function transactionGenerated(Request $request) {
													$orderId = null;
													$orderParcelId = null;
													$pathFile = 'storage/';
													$nameFile = '';
													$input = $request->all();

													switch ($request->get('key')) {
														case 'order':
															$model = OrderModel::find($request->get('id'));

															$orderId = $request->get('id');
															$pathFile .= 'order';
															$nameFile = "bankTransfer-receipt_{$orderId}.";
															break;
															case 'orderParcel':
																$model = OrderParcelModel::find($request->get('id'));

																$orderId = $model->order_id;
																$orderParcelId = $model->id;
																$pathFile .= "orderParcel/{$orderId}";
																$nameFile = "bankTransfer-receipt_{$orderParcelId}.";

																if (isset($input['value_check']) && $input['value_check']) {
																	$input['value_paid'] = $input['value_check'];
																}
																break;
															}

															if (isset($model)) {
																if(!empty($request->file('receipt_file'))) {
																	$file = $request->file('receipt_file');

																	$extension = strtolower($file->getClientOriginalExtension());
																	$file->move($pathFile, $nameFile . $extension);

																	$input['receipt_file'] = $pathFile . '/' . $nameFile . $extension;
																}

																if ($request->get('key') == 'order' && $input['status'] == 'AP' && !in_array($model->status, ['PE', 'PA', 'BL', 'TRC'])) {
																	unset($input['status']);

																	$model->fill($input)->save();

																	return $this->studentRegistration($model);
																} else {

																	$model->fill($input)->save();

																	if ($request->get('key') == 'order' && $input['status'] == 'AP') {
																		(new StudentClassControlUtils)->generateByOrder($request->get('id'));
																	}

																}
															}

															if (!is_null($orderId)) {
																CronOrderBlocked::run([ $orderId ]);
															}

															return redirect()->back();
														}

