																function generateTransaction(Request $request) {
																	$showError = null;

																	try {
																		$order = OrderModel::find($request->get('id'));

																		$opts = new \stdClass;

																		if ($order->course_id) {
																			$opts->course_id = $order->course_id;
																		}

																		$confirmPaymentUtils = new ConfirmPaymentUtils($opts);

																		$payload = [];

																		$confirmPaymentUtils->getAsaasCustomerCode($order->student_id, $payload);

																		$order->fill($payload)->save();

																		if (in_array($order->form_payment, [ 'card', 'bankSlip' ])) {
																			$confirmPaymentUtils->paymentAsaas($order);
																		} else {
																			$confirmPaymentUtils->makeOrderParcel($order);
																		}
																	} catch (\Throwable $th) {
																		$showError = $th->getCode() == 999 ? $th->getMessage() : [
																			'errors' => [
																				[
																					'Code' => $th->getCode(),
																					'description' => "{$th->getMessage()} \n File: {$th->getFile()} \n Line: {$th->getLine()}",
																					]
																					]
																				];

																				ErrorAsaasModel::where('order_id', $order->id)->forceDelete();
																				(new ErrorAsaasModel)->fill([
																					'order_id' => $order->id,
																					'json' => $showError,
																					])->save();
																				}

																				return redirect()->back()->withInput([
																					'showError' => $showError,
																				]);
																			}

																			function finish(Request $request, $id) {
