																			function getListAjax(Request $request) {

																				$orderModel = OrderModel::withTrashed()
																				->select('order.*')
																				->join('student', 'student.id', 'order.student_id')
																				->join('class', 'class.id', 'order.class_id')
																				->leftJoin('user AS responsible', 'responsible.id', 'order.responsible_id')
																				->with([
																					'student',
																					'course.courseCategoryType',
																					'course.courseCategory',
																					'course.courseSubcategory',
																					'class',
																					'responsible',
																					])
																					->whereNull('order.order_id')
																					->whereNotNull('order.course_id');

																					switch ($request->get('tab')) {
																						case 'free':
																							$orderModel->where(function($query) {
																								$query->whereHas('formPayment', function($query) {
																									$query->whereNotNull('flg_free');
																								})->whereNull('order.imported')
																								->where('full_value', 0)
																								->orWhereHas('course.courseSubcategory', function($query) {
																									$query->where('flg', 'cgr');
																								});
																							});
																							break;
																							case 'active':
																								$orderModel->whereIn('order.status', ['PE', 'AP', 'LC', 'BL'])
																								->where(function($query) {
																									$query->where('full_value', '>', 0)
																									->whereHas('formPayment', function($query) {
																										$query->whereNull('flg_free');
																									})->orWhereHas('course.courseSubcategory', function($query) {
																										$query->where('flg', '!=', 'cgr');
																									});
																								});
																								break;
																								case 'blocked':
																									$orderModel->whereIn('order.status', ['BL']);
																									break;
																									case 'finish':
																										$orderModel->whereIn('order.status', ['FI', 'CA', 'TR', 'TRC'])
																										->where(function($query) {
																											$query->whereHas('formPayment', function($query) {
																												$query->whereNull('flg_free')->where('full_value','>', 0);
																											});
																										});
																										break;
																									}

																									if($request->get('search') && $request->get('search')['value']) {
																										$search = trim($request->get('search')['value']);

																										$orderModel->where(function($query) use ($search) {
																											preg_match('/\d{2}\/\d{2}\/\d{4}/', $search, $match);

																											if ($match) {
																												$query->whereRaw("DATE_FORMAT(`order`.created_at, '%d/%m/%Y') = '{$search}'");
																											} else {
																												$query->where('order.id', $search);
																												$query->orWhere('student.name', 'like', "%{$search}%");
																												$query->orWhere('class.name', 'like', "%{$search}%");
																												$query->orWhere('responsible.name', 'like', "%{$search}%");
																												$query->orWhere('student.cpf', 'like', "%{$search}%");
																											}
																										});
																									};

																									foreach ($request->get('order') as $order) {
																										if ($order['column'] < 7) {
																											$column = $request->get('columns')[$order['column']]['data'];

																											$column = str_replace(['statusIcon'], ['status'], $column);

																											if (!preg_match('/\./', $column)) {
																												$column = "order.{$column}";
																											}

																											$orderModel->orderBy($column, $order['dir']);
																										}
																									}

																									$count = $orderModel->count();

																									$orderData = $orderModel->limit($request->get('length'))->offset($request->get('start'))->get()->toArray();

																									foreach ($orderData as &$data) {
																										if (!$data['responsible_id'] && $data['imported'] == 1) {
																											$data['responsible'] = [ 'name' => 'IMPORTAÇÃO' ];
																										}
																									}

																									return [
																										'recordsTotal' => $count,
																										'recordsFiltered' => $count,
																										'data' => $orderData,
																									];
																								}

																								function matriculationTransfer(Request $request, $idOrder, $status = null) {
																									$status = ($status ?? 'TR');

																									$orderModel = OrderModel::with([
																										'orderParcel' => function($query) {
																											$query->whereNotNull('payday');
																										},
																										'course',
																										])->find($idOrder);

																										$orderModel->fill([ 'status' => $status ])->save();

																										$this->cancellationParcelAssas($idOrder);

																										return $this->studentRegistration($orderModel);
																									}

																									private function studentRegistration($orderModel) {
																										$credit = (object) [
																											'financialCredit' => 0,
																											'hoursCredit' => 0,
																											'hoursLoad' => $orderModel->course->hours_load,
																										];

																										foreach ($orderModel->orderParcel as $orderParcel) {
																											if (!empty($orderParcel->payday)) {
																												$credit->financialCredit += ($orderParcel->value_paid > 0 ? $orderParcel->value_paid : $orderParcel->value);
																											}
																										}

																										return redirect("/admin/student_registration?status={$orderModel->status}&student={$orderModel->student_id}&lastOrder={$orderModel->id}&financialCredit={$credit->financialCredit}");
																									}

																									public function getValueNotPaid(Request $request) {
																										return $this->_getValueNotPaid($request->get('id'));
																									}

																									public function cancellationProcess(Request $request) {
																										$input = $request->all();

																										if (empty($input['notGenerateFine'])) {
																											$valueNotPaid = $this->_getValueNotPaid($request->get('id'));

																											$input['fine_value'] = $valueNotPaid['fineValue'];
																										} else {
																											$input['formpayment_of_fine'] = 'notGenerateFine';
																										}

																										$order = OrderModel::find($request->get('id'));

																										if ($input['formpayment_of_fine'] == 'bankSlip') {
																											$asaasData = [
																												'path' => 'payments',
																												'payload' => [
																													'billingType' => 'BOLETO',
																													'customer' => $order->asaas_customers_code,
																													'description' => "Multa de cancelamento",
																													'externalReference' => $order->code,
																													'value' => $input['fine_value'],
																													'dueDate' => date("Y-m-d", strtotime('+7 day', strtotime('now'))),
																												],
																											];

																											$confirmPaymentUtils = new ConfirmPaymentUtils((object) [
																												'course_id' => $order->course_id,
																											]);

																											$asaas = $confirmPaymentUtils->asaas($asaasData);

																											$input['asaas_fine'] = json_encode($asaas);
																										}

																										$this->cancellationParcelAssas($request->get('id'));

																										$input['status'] = 'CA';

																										$order->fill($input)->save();

																										OrderParcelModel::where('order_id', $request->get('id'))->delete();

																										return redirect()->back();
																									}

																									private function _getValueNotPaid($idOrder) {
																										$orderModel = OrderModel::with([
																											'orderParcel' => function($query) {
																												$query->whereNull('payday');
																											},
																											])->find($idOrder);

																											$valueNotPaid = 0;

																											foreach ($orderModel->orderParcel as $orderParcel) {
																												$valueNotPaid += ($orderParcel->value_paid > 0 ? $orderParcel->value_paid : $orderParcel->value);
																											}

																											return [
																												'valueNotPaid' => number_format($valueNotPaid, 2, '.', ''),
																												'fineValue' => number_format($valueNotPaid * .2, 2, '.', ''),
																											];
																										}

																										private function cancellationParcelAssas($idOrder) {
																											$orderModel = OrderModel::with([
																												'orderParcel' => function($query) {
																													$query->whereNull('payday');
																												},
																												])->find($idOrder);

																												$confirmPaymentUtils = new ConfirmPaymentUtils((object) [
																													'course_id' => $orderModel->course_id,
																												]);

																												foreach ($orderModel->orderParcel as $orderParcel) {
																													if ($orderParcel->asaas_code) {
																														$confirmPaymentUtils->asaas([
																															'method' => 'DELETE',
																															'path' => 'payments/' . $orderParcel->asaas_code,
																														]);
																													}
																												}
																											}
																										}
